import "./navbarProf.scss";
// import NotificationsNoneOutlinedIcon from "@mui/icons-material/NotificationsNoneOutlined";
import { Link } from "react-router-dom";
import Cookies from "js-cookie";
import Axios from "axios";
import { useState, useEffect } from "react";

const Navbar = () => {
  //get the loggedIn id
  const id = Cookies.get("userId");

  //fetch data from the server to display them in our page
  const [fname, setFname] = useState("");
  const [lname, setLname] = useState("");

  useEffect(() => {
    let mounted = true;
    Axios.get(`http://localhost:3001/profile/${id}`).then((response) => {
      if (mounted) {
        setFname(response.data[0].firstName);
        setLname(response.data[0].lastName);
        // console.log(response.data[0]);
      }
    });
    return () => {
      mounted = false;
    };
  }, [id]);

  return (
    <div className="navbar">
      <div className="wrapper">
        <div className="left">{"Prof.  " + fname + " " + lname}</div>
        <div className="items">
          {/* <div className="item">
            <NotificationsNoneOutlinedIcon className="icon" />
            <div className="counter">1</div>
          </div> */}
          <div className="item">
            <Link to="/prof/profile">
              <img
                src="data:image/jpeg;base64,"
                alt=""
                className="avatar"
              />
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
